    return (
        <header className="App-header">
            <nav className="nav">
            <img src={logo} className="App-logo" alt="logo" className="nav-logo" />
                <ul className="nav-items">
                    <li>Pricing</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </nav>
        </header>
    )
}
